/********************************************************************
* FUNCTION microwave_model_mw_tdm_container_pac_edit
* 
* Edit database object callback
* Path: /mw-tdm-container-pac
* Add object instrumentation in COMMIT phase.
* 
* INPUTS:
*     see agt/agt_cb.h for details
* 
* RETURNS:
*     error status
********************************************************************/
static status_t microwave_model_mw_tdm_container_pac_edit (
    ses_cb_t *scb,
    rpc_msg_t *msg,
    agt_cbtyp_t cbtyp,
    op_editop_t editop,
    val_value_t *newval,
    val_value_t *curval)
{
    status_t res = NO_ERR;
    val_value_t *errorval = (curval) ? curval : newval;
    val_value_t *lastkey = NULL;
    const xmlChar *k_mw_tdm_container_pac_layer_protocol = VAL_STRING(agt_get_key_value(errorval, &lastkey));

    if (LOGDEBUG) {
        log_debug("\nEnter microwave_model_mw_tdm_container_pac_edit callback for %s phase",
            agt_cbtype_name(cbtyp));
    }

    res = u_microwave_model_mw_tdm_container_pac_edit(scb, msg, cbtyp, editop, newval, curval,
        k_mw_tdm_container_pac_layer_protocol);

    if (res == NO_ERR && cbtyp == AGT_CB_COMMIT) {
        res = agt_check_cache(&mw_tdm_container_pac_val, newval, curval, editop);
    }
    
    if (res == NO_ERR && cbtyp == AGT_CB_COMMIT && curval == NULL) {
        res = microwave_model_mw_tdm_container_pac_mro(newval);
    }

    if (res != NO_ERR) {
        agt_record_error(
            scb,
            &msg->mhdr,
            NCX_LAYER_CONTENT,
            res,
            NULL,
            (errorval) ? NCX_NT_VAL : NCX_NT_NONE,
            errorval,
            (errorval) ? NCX_NT_VAL : NCX_NT_NONE,
            errorval);
    }
    return res;

} /* microwave_model_mw_tdm_container_pac_edit */
